import { Component } from "react";
import Profile from "./Profile/Profile";

import { HorizontalLogo } from "../../../shared/logo/Logos";

import "./Head.css";

class Head extends Component
{
    props:any = this.props
    state = {
        displaySenderInformation : true
    }

    render(){
        return (
            <div className="homepage-head">
                {
                    ((!this.state.displaySenderInformation)?
                    (<div className = "logo-information"> <HorizontalLogo /> </div>):(null))    
                }
                <div className = "sender-information"><Profile userData = {this.props.ReceiverProfile} /></div>
                {
                    (this.state.displaySenderInformation)?
                    <div className = "receiver-information"><Profile userData = {this.props.senderProfile} /></div>: null
                }
            </div>
        )
    }
}

export default Head
